[{"location":"schema/#Schema","page":"Schema","title":"Schema","text":"","category":"section"},{"location":"schema/","page":"Schema","title":"Schema","text":"Modules = [AWSBraket.Schema]","category":"page"},{"location":"#AWSBraket","page":"Quick Start","title":"AWSBraket","text":"","category":"section"},{"location":"#API-References","page":"Quick Start","title":"API References","text":"","category":"section"},{"location":"","page":"Quick Start","title":"Quick Start","text":"Modules = [AWSBraket]","category":"page"},{"location":"#AWSBraket.DeviceMenu-Tuple{}","page":"Quick Start","title":"AWSBraket.DeviceMenu","text":"DeviceMenu([devices, regions]; pagesize::Int=5)\n\nCreate a DeviceMenu to display available devices interactively in the Julia REPL.\n\nArguments\n\ndevices::Vector{Schema.DeviceInfo}: optional, a list of devices.\nregions::Vector{String}: optional, a list of regions corresponding to the device list.\n\n\n\n\n\n","category":"method"},{"location":"#AWSBraket.cancel_quantum_task-Tuple{String, String}","page":"Quick Start","title":"AWSBraket.cancel_quantum_task","text":"cancel_quantum_task(client_token::String, task_arn::String)\n\nCancel quantum task given by client_token and its task_arn.\n\nAWS Service Configuration\n\nYou can specify custom configuration via aws_config keyword argument,  to select another regions or use a different account, default is AWS.global_aws_config(), e.g you can choose a different region in this config\n\nusing AWS\nconfig = AWSConfig(;region=\"us-west-1\")\n\nSee the AWS Julia Interface documentation for more advanced usage.\n\n\n\n\n\n","category":"method"},{"location":"#AWSBraket.create_quantum_task-Tuple{}","page":"Quick Start","title":"AWSBraket.create_quantum_task","text":"create_quantum_task(;kw...)\n\nCreate a quantum task in braket service.\n\nRequired Keyword Arguments\n\nprogram::Schema.Program: the program one wants to execute.\ndevice_arn::String: device arn.\nbucket::String: S3 bucket to store the results in.\nfolder::String: S3 bucket folder.\n\nOptional Keyword Arguments\n\ndisable_qubit_rewiring::Bool: disable qubit rewiring in braket service, default is false.\ndevice_parameters: device parameters, such as Schema.IonqDeviceParameters,   Schema.RigettiDeviceParameters, default is inferred from previous arguments.\nnshots: number of shots, default is 100.\nclient_token: a UUID for the client token, will generate one by default.\ntags::Dict{String, String}: a list of tags you would to attach to this task.\n\nAWS Service Configuration\n\nYou can specify custom configuration via aws_config keyword argument,  to select another regions or use a different account, default is AWS.global_aws_config(), e.g you can choose a different region in this config\n\nusing AWS\nconfig = AWSConfig(;region=\"us-west-1\")\n\nSee the AWS Julia Interface documentation for more advanced usage.\n\n\n\n\n\n","category":"method"},{"location":"#AWSBraket.get_device-Tuple{String}","page":"Quick Start","title":"AWSBraket.get_device","text":"get_device(arn::String; aws_config=AWS.global_aws_config())\n\nRetrieves the devices available in Amazon Braket.\n\nArguments\n\narn: The ARN of the device to retrieve.\n\nAWS Service Configuration\n\nYou can specify custom configuration via aws_config keyword argument,  to select another regions or use a different account, default is AWS.global_aws_config(), e.g you can choose a different region in this config\n\nusing AWS\nconfig = AWSConfig(;region=\"us-west-1\")\n\nSee the AWS Julia Interface documentation for more advanced usage.\n\n\n\n\n\n","category":"method"},{"location":"#AWSBraket.get_quantum_task-Tuple{String}","page":"Quick Start","title":"AWSBraket.get_quantum_task","text":"get_quantum_task(task_arn::String)\n\nGet the quantum task from task_arn.\n\nAWS Service Configuration\n\nYou can specify custom configuration via aws_config keyword argument,  to select another regions or use a different account, default is AWS.global_aws_config(), e.g you can choose a different region in this config\n\nusing AWS\nconfig = AWSConfig(;region=\"us-west-1\")\n\nSee the AWS Julia Interface documentation for more advanced usage.\n\n\n\n\n\n","category":"method"},{"location":"#AWSBraket.make_device_parameters-Tuple{AWSBraket.Schema.Program, String, Bool}","page":"Quick Start","title":"AWSBraket.make_device_parameters","text":"make_device_parameters(program::Schema.Program, arn::String, disable_qubit_rewiring::Bool)\n\nCreate device parameters from given program, device arn and disable_qubit_rewiring option.\n\n\n\n\n\n","category":"method"},{"location":"#AWSBraket.search_devices","page":"Quick Start","title":"AWSBraket.search_devices","text":"search_devices(filters=[]; max_results::Maybe{Int}=nothing, next_token::Maybe{String}=nothing, aws_config=AWS.global_aws_config())\n\nSearches for devices using the specified filters.\n\nArguments\n\nfilters: The filter values to use to search for a device.\n\nKeyword Arguments (Optional)\n\nmax_results: The maximum number of results to return in the response.\nnext_token: A token used for pagination of results returned in the response. Use the token returned from   the previous request continue results where the previous request ended.\n\nAWS Service Configuration\n\nYou can specify custom configuration via aws_config keyword argument,  to select another regions or use a different account, default is AWS.global_aws_config(), e.g you can choose a different region in this config\n\nusing AWS\nconfig = AWSConfig(;region=\"us-west-1\")\n\nSee the AWS Julia Interface documentation for more advanced usage.\n\n\n\n\n\n","category":"function"}]
